  //Path Variable
  const { id } = useParams()
  console.log(id)

  const diaryList = useContext(DiaryStateContext)

  useEffect(() => {
    if (diaryList.length >= 1) {
      const targetDiary = diaryList.find((it) => Number(it.id) === Number(id))
    }
  }, [])

  return <div>Diary</div>
}

export default Diary
